import Card from "./card.js";

export default function PlayerList(props) {
    if (props.position == 'Point Guard') {
        return <>
    <ul>
        {props.players.map(players => <li key={players.id}>
            <Card playerDetails={players} onDeletechange ={props.onDeletechange} />
        </li>)}
        

    </ul>
    </>;
    }
    else {
        return <>
    <ul>
        {props.players.map(players => <li key={players.id}>
            <Card playerDetails={players} onDeletechange ={props.onDeletechange} />
        </li>)}
        

    </ul>
    </>;
        }
}
